import React from 'react'
import useHook from './CustomHook'

const App =() =>{
    const H = useHook()
    const H1 = useHook(20)

    return(
        <>
            <h1>this is count : {H.count}</h1>
            <h1>this is count : {H1.count}</h1>
            <button onClick={H.increment}>click</button>
            <button onClick={H1.increment}>click</button>
        </>
    )
}
export default App
